"use strict";function getCookie(name){var cookieArr=document.cookie.split(";");for(var i=0;i<cookieArr.length;i++){var cookiePair=cookieArr[i].split("=");if(name==cookiePair[0].trim()){return decodeURIComponent(cookiePair[1])}}return null}function getCookieLength(){if(document.cookie=="")return 0;var cookieArr=document.cookie.split(";");var i=0;for(i=0;i<cookieArr.length;i++){var cookiePair=cookieArr[i].split("=")}return i}function clearAllCookie(){var keys=document.cookie.match(/[^ =;]+(?=\=)/g);if(keys){for(var i=keys.length;i--;)document.cookie=keys[i]+'=0;expires='+new Date(0).toUTCString()}}function removeCookie(cname){var name=cname+"=";var ca=document.cookie.split(';');var cookieStr="";for(var i=0;i<ca.length;i++){var c=ca[i].trim();if(c.indexOf(name)==0){document.cookie=c+';expires='+new Date(0).toUTCString()}else{cookieStr+=c;cookieStr+=";"}document.cookie=cookieStr}}function check(){document.cookie="__CookieTest__=text";if(getCookie("__CookieTest__")!="text")return false;else{removeCookie("__CookieTest__");return true}}